import User from "./User";
import "./App.css";
function App() {
  let users = [
    { name: "negar", age: 27, height: 180 },
    { name: "ali", age: 29, height: 170 },
    { name: "roya", age: 20, height: 190 },
  ];
  return (
    <div className="row">
      <User {...users[0]} />
      <User {...users} />
      <User />
    </div>
  );
}

export default App;
